  \"2016-11-25T21:06:12.791257\",\n\t\"name\": \"vocational-programs-in-secondary-schools-1999\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"Vocational Programs in Secondary Schools,
  1999 (FRSS 72), is a study that is part of the Fast Response Survey System (FRSS)
  program; program data is available since 1998-99 at http://nces.ed.gov/surveys/frss/downloads.asp.
  FRSS 72 http://nces.ed.gov/surveys/frss/index.asp is a cross-sectional survey that
  collected information from secondary schools in the United States about availability
  of vocational education programs and courses. This study was conducted using surveys
  of secondary school principals. 1,150 secondary schools in the United States were
  sampled. The study's unweighted response rate was 94 percent. The weighted response
  rate was 95 percent. Key statistics produced from FRSS 72 are on program offerings,
  relevant job skills, skill competency lists, and credentialing process.\",\n\t\"license_title\":
